import React, { Component } from 'react';
import { connect } from 'react-redux';
import { postUserInfo } from '../../Actions/actionCreator';

class Login extends Component {

    render() {
        return (
            <div>
                <form onSubmit={this.props.postUserInfo}>
                    <input value={this.props.user.username} name="username" onChange={e => () => (e.target.value)} placeholder="enter username" type="text"></input>
                    <input value={this.props.user.password} name="password" onChange={e => () => (e.target.value)} placeholder="enter password" type="password"></input>
                    <button type="submit">Log In</button>
                </form>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    user : state.user.user
});

const mapDispatchToProps = {
    postUserInfo
}

export default connect(mapStateToProps, mapDispatchToProps)(Login);
